import React from 'react';

const TrackSearchResult = ({playingTrack, chooseTrack, lyrics, titre, artist}) => {

    function handlePlay(){
        chooseTrack(playingTrack)
    }

    console.log("Track: ", playingTrack)    
    console.log("Lyrics: ", lyrics)

    return (
        <div
          className="d-flex m-2 align-items-center"
          style={{ cursor: "pointer" }}
          onClick={handlePlay}
        >
            <div className="ml-3">
            <div>1: {titre}</div>
            <div className="text-muted">2: {artist}</div>
            <div>3: {lyrics}</div>
          </div>
        </div>
      )
};

export default TrackSearchResult;
